syntax = "proto3";

package flexport.os.grpc.type.datetime.v1beta1;

option java_multiple_files = true;
option java_outer_classname = "TimeZonesProto";
option java_package = "com.flexport.os.grpc.type.datetime.v1beta1";
option ruby_package = "Flexport::OS::Grpc::Type::DateTime::V1Beta1";

// Time zones are standards associated with a geography, eg. "America/Los_Angeles".
// It is recommended to use time zones tied to regions, rather than constant offsets eg. "UTC-7"
// since the region will observe certain rules, for example Daylight Savings Time.
// In current implementation, we represent timezone as TzIana enum value that is mapped 1:1 to
// standard Java time zone ids.
// For example, java time zone "America/Los_Angeles" is mapped to enum value TZ_IANA_AMERICA_0_LOS_ANGELES
message TimeZone {
  oneof by {
    TzIana iana = 1;
    TzUtc utc = 2;
  }
}

